import React, { Component } from "react";

import { Switch, Route } from 'react-router-dom';
import Services from './Services';

import DrawerToggleButton from '../SideDrawer/DrawerToggleButton';
import './Toolbar.css';

export default class Toolbar extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
  <header className="toolbar">
    <nav className="toolbar__navigation">
        <div className="toolbar__toggle-button">
            <DrawerToggleButton click={this.props.drawerClickHandler} />
        </div>
        <div className="toolbar__logo"><a href="/">CA comunidade</a></div>
        <div className="spacer" />
        <div className="toolbar_navigation-items">
            <ul>
              <Switch>
                {/* <li><Route path="/" component={Perfil} /></li> */}
                {/* <li><Route path="/" component={Mensagens} /></li> */}
                <li><Route path="/Services" component={Services} /></li>
                {/* <li><Route path="/" component={Contactos} /></li> */}
              </Switch>
            </ul>
        </div>
    </nav>
  </header>
);
    }
  }
